import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';
import { Pagination, Navigation } from 'swiper/modules';

// Import Swiper styles
import 'swiper/css';

const Demo = () => {
  return (
    <>
      <Swiper
        pagination={{ type: 'progressbar' }}
        navigation={true}
        modules={[Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide style={{ padding: '20px', listStyleType: 'disc' }}>
          <div>
            <p>tea</p>
            <p>rum</p>
          </div>
        </SwiperSlide>
        <SwiperSlide style={{ padding: '20px', listStyleType: 'disc' }}>
          <div>
            <p>Item 1</p>
            <p>Item 2</p>
          </div>
        </SwiperSlide>
        {/* Add more SwiperSlides with your content */}
      </Swiper>
    </>
  );
};

export default Demo;
